import React from 'react';

import './c_project.css'
import { v4 as uuidv4 } from 'uuid';
import MultiSelect2 from "multi-select2";




function create_project (){

    const myData = [
        {
          label: "CSS",
          value: "css"
        },
        {
          label: "HTML",
          value: "html"
        },
        {
          label: "JavaScript",
          value: "js"
        }
  ],
  mySelect = new MultiSelect2(".element", {
    options: myData
});


    return (
        <>

            <div className="container">

            <form>
                <p className="deftvalue">Project ID</p>
                <div className="group"> 
                <input type="text" 
                required 
                disabled
                defaultValue={uuidv4()}
                />
                <span className="highlight"></span>
                <span className="bar"></span>

                </div>

                <div className="group">      
                <input type="text" required/>
                <span className="highlight"></span>
                <span className="bar"></span>
                <label>Project Name</label>
                </div>

                <div className="group">      
                <input type="text" required/>
                <span className="highlight"></span>
                <span className="bar"></span>
                <label>Master</label>
                </div>


                <div className="element">
                    {mySelect}
                </div>

            </form>



            </div>








        </>
      );

}


export default create_project
